import React, { useState, useEffect } from 'react';
import { FiClock, FiMail, FiArrowRight, FiCheck } from 'react-icons/fi';
import './ComingSoon.css';

const ComingSoon = () => {
  const [email, setEmail] = useState('');
  const [isSubmitted, setIsSubmitted] = useState(false);
  const [countdown, setCountdown] = useState({
    days: 0,
    hours: 0,
    minutes: 0,
    seconds: 0
  });
  
  // Set launch date - example: 30 days from now
  const calculateTimeLeft = () => {
    const launchDate = new Date();
    launchDate.setDate(launchDate.getDate() + 30); // 30 days from now
    
    const difference = launchDate - new Date();
    
    if (difference > 0) {
      setCountdown({
        days: Math.floor(difference / (1000 * 60 * 60 * 24)),
        hours: Math.floor((difference / (1000 * 60 * 60)) % 24),
        minutes: Math.floor((difference / 1000 / 60) % 60),
        seconds: Math.floor((difference / 1000) % 60)
      });
    }
  };
  
  useEffect(() => {
    calculateTimeLeft();
    const timer = setInterval(calculateTimeLeft, 1000);
    
    return () => clearInterval(timer);
  }, []);
  
  const handleSubmit = (e) => {
    e.preventDefault();
    // Here you would typically send the email to your backend
    console.log('Notify email:', email);
    
    // For demonstration, we'll just show a success message
    setIsSubmitted(true);
    setEmail('');
    
    // Reset submission status after 3 seconds
    setTimeout(() => {
      setIsSubmitted(false);
    }, 3000);
  };
  
  return (
    <div className="coming-soon-container">
      <div className="coming-soon-content">
        <h1 className="coming-soon-title">
          <span className="gradient-text">Coming Soon</span>
        </h1>
        
        <p className="coming-soon-description">
          We're working hard on this feature. Stay tuned for an amazing real estate experience!
        </p>
        
        <div className="countdown-container">
          <div className="countdown-box">
            <div className="countdown-value">{countdown.days}</div>
            <div className="countdown-label">Days</div>
          </div>
          <div className="countdown-box">
            <div className="countdown-value">{countdown.hours}</div>
            <div className="countdown-label">Hours</div>
          </div>
          <div className="countdown-box">
            <div className="countdown-value">{countdown.minutes}</div>
            <div className="countdown-label">Minutes</div>
          </div>
          <div className="countdown-box">
            <div className="countdown-value">{countdown.seconds}</div>
            <div className="countdown-label">Seconds</div>
          </div>
        </div>
        
        <div className="notification-form">
          <h2 className="form-title">
            <FiClock className="icon" /> Get Notified When We Launch
          </h2>
          
          {isSubmitted ? (
            <div className="success-message">
              <FiCheck className="success-icon" /> Thank you! We'll notify you when we launch.
            </div>
          ) : (
            <form onSubmit={handleSubmit}>
              <div className="input-group">
                <FiMail className="input-icon" />
                <input
                  type="email"
                  placeholder="Enter your email"
                  value={email}
                  onChange={(e) => setEmail(e.target.value)}
                  required
                />
                <button type="submit" className="submit-btn">
                  Notify Me <FiArrowRight />
                </button>
              </div>
            </form>
          )}
        </div>
        
        <div className="coming-soon-footer">
          <p>Contact us at <a href="mailto:info@realestate.com">info@realestate.com</a></p>
          <button 
            className="back-btn"
            onClick={() => window.history.back()}
          >
            Back to Dashboard
          </button>
        </div>
      </div>
    </div>
  );
};

export default ComingSoon;
